INSERT INTO `entrada` (`titulo`, `contenido`, `fecha_entrada`) VALUES
('Descripcion', '\r\n\r\n<p>Un <strong>blog</strong>â€‹ o <strong>bit&aacute;cora</strong>â€‹ es un sitio web que incluye, a modo de diario personal de su autor o autores, contenidos de su inter&eacute;s, actualizados con frecuencia y a menudo comentados por los lectores.<sup id=\"cite_ref-DRAE_1-1\" class=\"reference separada\"></sup></p>\r\n<p>&nbsp;</p>\r\n<p>Sirve como publicaci&oacute;n en l&iacute;nea de historias con una periodicidad muy alta, que son presentadas en orden cronol&oacute;gico inverso, es decir, lo m&aacute;s reciente que se ha publicado es lo primero que aparece en la pantalla. Antes era frecuente que los blogs mostraran una lista de enlaces a otros blogs u otras p&aacute;ginas para ampliar informaci&oacute;n, citar fuentes o hacer notar que se contin&uacute;a con un tema que empez&oacute; otro blog.</p>\r\n<p>&nbsp;</p>\r\n<p>Actualmente un blog puede tener diversas finalidades <sup id=\"cite_ref-3\" class=\"reference separada\"></sup>seg&uacute;n el tipo, taxonom&iacute;a o incluso su autor&iacute;a, como por ejemplo para reforzar la marca personal del autor, generar informaci&oacute;n para comunidades tem&aacute;ticas concretas o incluso servir como medio para buscar oportunidades laborales.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"\" /></p>\r\n<h3>Datos</h3>\r\n<p>Habitualmente, en cada art&iacute;culo de un blog, los lectores pueden escribir sus comentarios y el autor darles respuesta, de esa forma pueden interactuar.</p>\r\n<h3>Historia</h3>\r\n<p>Antes de que los blogs se hicieran populares, exist&iacute;an comunidades digitales como USENET, xrt listas de correo electr&oacute;nico y BBS. En los a&ntilde;os 90, los programas para crear foros de internet, por ejemplo WebEx, posibilitaron conversaciones con <em>hilos</em>. Los hilos son mensajes que est&aacute;n relacionados con un tema del foro.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"\" /></p>\r\n<p>El blog moderno es una evoluci&oacute;n de los <a class=\"new\" title=\"Diario online (a&uacute;n no redactado)\" href=\"https://es.wikipedia.org/w/index.php?title=Diario_online&amp;action=edit&amp;redlink=1\">diarios en l&iacute;nea</a>, donde la gente escrib&iacute;a sobre su vida personal, como si fuese un diario &iacute;ntimo pero d&aacute;ndole difusi&oacute;n en la red. Las p&aacute;ginas abiertas <a class=\"mw-redirect\" title=\"Webring\" href=\"https://es.wikipedia.org/wiki/Webring\">Webring</a> inclu&iacute;an a miembros de la comunidad de diarios en l&iacute;nea. <a class=\"new\" title=\"Justin Hall (a&uacute;n no redactado)\" href=\"https://es.wikipedia.org/w/index.php?title=Justin_Hall&amp;action=edit&amp;redlink=1\">Justin Hall</a>, quien escribi&oacute; desde 1994 su blog personal mientras era estudiante de la <a class=\"mw-redirect\" title=\"Universidad de Swarthmore\" href=\"https://es.wikipedia.org/wiki/Universidad_de_Swarthmore\">Universidad de Swarthmore</a>, es reconocido generalmente como uno de los primeros blogueros</p>\r\n<h3>Actualmente</h3>\r\n<p>Entre los servidores de blogs m&aacute;s populares se encuentran <a title=\"Blogger\" href=\"https://es.wikipedia.org/wiki/Blogger\">Blogger</a> y <a class=\"mw-redirect\" title=\"Wordpress\" href=\"https://es.wikipedia.org/wiki/Wordpress\">Wordpress</a>. Los cofundadores de <a title=\"Twitter\" href=\"https://es.wikipedia.org/wiki/Twitter\">Twitter</a>, <a title=\"Evan Williams (blogger)\" href=\"https://es.wikipedia.org/wiki/Evan_Williams_(blogger)\">Evan Williams</a> y <a title=\"Biz Stone\" href=\"https://es.wikipedia.org/wiki/Biz_Stone\">Biz Stone</a>, crearon la plataforma de escritura <a title=\"Medium (servicio)\" href=\"https://es.wikipedia.org/wiki/Medium_(servicio)\">Medium</a>.</p>\r\n<p>&nbsp;</p>', '2017-11-14 13:41:57');
INSERT INTO `entrada` (`titulo`, `contenido`, `fecha_entrada`) VALUES
('Dificultades', '\r\n<h1 style=\"text-align: justify;\">Entradas</h1>\r\n<p style=\"text-align: justify;\">A la hora de crear entradas ten&iacute;amos un formato de entrada que no era v&aacute;lido y lo hemos tenido que cambiar usando un editor de texto para HTML.</p>\r\n<h1><img id=\"imagenart\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"uploads/entrada_imagenes/Dificultad1.png\" width=\"334\" height=\"364\" /></h1>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<h1 style=\"text-align: justify;\">Hosting</h1>\r\n<p>Nuestro hosting no permit&iacute;a el uso adecuado de las variables de sesi&oacute;n, por lo tanto, cambiamos todo al servidor local que tenemos en clase.</p>\r\n<p><img id=\"imagenart\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"uploads/entrada_imagenes/Dificultad2.png\" width=\"412\" height=\"254\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img id=\"imagenart\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"uploads/entrada_imagenes/Dificultad3.png\" width=\"400\" height=\"247\" /></p>', '2017-11-13 13:48:51'),
('Jquery', '\r\n<h1><strong>jQuery</strong></h1>\r\n<p><strong>jQuery</strong> es una biblioteca multiplataforma de JavaScript, creada inicialmente por John Resig, que permite simplificar la manera de interactuar con los documentos HTML, manipular el &aacute;rbol DOM, manejar eventos, desarrollar animaciones y agregar interacci&oacute;n con la t&eacute;cnica AJAX a p&aacute;ginas web. Fue presentada el 14 de enero de 2006 en el BarCamp NYC. jQuery es la biblioteca de JavaScript m&aacute;s utilizada.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>jQuery</strong> es software libre y de c&oacute;digo abierto, posee un doble licenciamiento bajo la Licencia MIT y la Licencia P&uacute;blica General de GNU v2, permitiendo su uso en proyectos libres y privados.<sup id=\"&quot;cite_ref-2&quot;\" class=\"&quot;reference\"> </sup>â€‹ jQuery, al igual que otras bibliotecas, ofrece una serie de funcionalidades basadas en JavaScript que de otra manera requerir&iacute;an de mucho m&aacute;s c&oacute;digo, es decir, con las funciones propias de esta biblioteca se logran grandes resultados en menos tiempo y espacio.</p>\r\n<p>&nbsp;</p>\r\n<p>Las empresas Microsoft y Nokia anunciaron que incluir&aacute;n la biblioteca en sus plataformas. â€‹ Microsoft la a&ntilde;adir&aacute; en su IDE Visual Studio â€‹ y la usar&aacute; junto con los frameworks ASP.NET AJAX y ASP.NET MVC, mientras que Nokia los integrar&aacute; con su plataforma Web Run-Time.</p>\r\n<p><img id=\"imagenart\" src=\"uploads/entrada_imagenes//jquery.png\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2><span id=\"&quot;Uso&quot;\" class=\"&quot;mw-headline&quot;\">Uso</span></h2>\r\n<p>&nbsp;</p>\r\n<p><strong>jQuery</strong> consiste en un &uacute;nico fichero JavaScript que contiene las funcionalidades comunes de DOM, eventos, efectos y AJAX.</p>\r\n<p>&nbsp;</p>\r\n<p>La caracter&iacute;stica principal de la biblioteca es que permite cambiar el contenido de una p&aacute;gina web sin necesidad de recargarla, mediante la manipulaci&oacute;n del &aacute;rbol DOM y peticiones AJAX. Para ello utiliza las funciones <code>$()</code> o <code>jQuery()</code>.</p>\r\n<p>&nbsp;</p>\r\n<h3><span id=\"&quot;Funci&oacute;n_$()&quot;\"></span><span id=\"&quot;Funci.C3.B3n_.24.28.29&quot;\" class=\"&quot;mw-headline&quot;\">Funci&oacute;n $()</span></h3>\r\n<p>\r\n</p>\r\n<p>La forma de interactuar con la p&aacute;gina es mediante la funci&oacute;n <code>$()</code>, un alias de <code>jQuery()</code>, que recibe como par&aacute;metro una expresi&oacute;n CSS o el nombre de una etiqueta HTML y devuelve todos los nodos (elementos) que concuerden con la expresi&oacute;n. Esta expresi&oacute;n es denominada <strong>selector</strong> en la terminolog&iacute;a de jQuery.<sup id=\"&quot;cite_ref-6&quot;\" class=\"&quot;reference\"></sup></p>\r\n<p>&nbsp;</p>\r\n<div class=\"&quot;mw-highlight\" dir=\"&quot;ltr&quot;\"><br />\r\n<pre><span class=\"&quot;nx&quot;\">$</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\"#tablaAlumnos\"</span><span class=\"&quot;p&quot;\">);</span> <span class=\"&quot;c1&quot;\">// Devolver&aacute; el elemento con id=\"tablaAlumnos\"</span>\r\n<span class=\"&quot;nx&quot;\">$</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\".activo\"</span><span class=\"&quot;p&quot;\">);</span>       <span class=\"&quot;c1&quot;\">// Devolver&aacute; una matriz de elementos con class=\"activo\"</span>\r\n</pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>Una vez obtenidos los nodos, se les puede aplicar cualquiera de las funciones que facilita la biblioteca.</p>\r\n<p>&nbsp;</p>\r\n<div class=\"&quot;mw-highlight\" dir=\"&quot;ltr&quot;\"><br />\r\n<pre><span class=\"&quot;c1&quot;\">// Se elimina el estilo (con removeClass()) y se aplica uno nuevo (con addClass()) a todos los nodos con class=\"activo\"</span>\r\n<span class=\"&quot;nx&quot;\">$</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\".activo\"</span><span class=\"&quot;p&quot;\">).</span><span class=\"&quot;nx&quot;\">removeClass</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\"activo\"</span><span class=\"&quot;p&quot;\">).</span><span class=\"&quot;nx&quot;\">addClass</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\"inactivo\"</span><span class=\"&quot;p&quot;\">);</span>\r\n</pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>O por ejemplo, efectos gr&aacute;ficos:</p>\r\n<p>&nbsp;</p>\r\n<div class=\"&quot;mw-highlight\" dir=\"&quot;ltr&quot;\"><br />\r\n<pre><span class=\"&quot;c1&quot;\">// Anima todos los componentes con class=\"activo\"</span>\r\n<span class=\"&quot;nx&quot;\">$</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\".activo\"</span><span class=\"&quot;p&quot;\">).</span><span class=\"&quot;nx&quot;\">slideToggle</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;s2&quot;\">\"slow\"</span><span class=\"&quot;p&quot;\">);</span>\r\n</pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<h3><span id=\"&quot;Inicio_de_jQuery&quot;\" class=\"&quot;mw-headline&quot;\">Inicio de jQuery</span></h3>\r\n<p>&nbsp;</p>\r\n<p>Com&uacute;nmente antes de realizar cualquier acci&oacute;n en el documento con <code>jQuery()</code>, debemos percatarnos de que el documento est&eacute; listo. Para ello usamos <code>$(document).ready();</code>, de esta forma:</p>\r\n<p>&nbsp;</p>\r\n<div class=\"&quot;mw-highlight\" dir=\"&quot;ltr&quot;\"><br />\r\n<pre><span class=\"&quot;nx&quot;\">$</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;nb&quot;\">document</span><span class=\"&quot;p&quot;\">).</span><span class=\"&quot;nx&quot;\">ready</span><span class=\"&quot;p&quot;\">(</span><span class=\"&quot;kd&quot;\">function</span><span class=\"&quot;p&quot;\">()</span> <span class=\"&quot;p&quot;\">{</span>\r\n   <span class=\"&quot;c1&quot;\">//Aqu&iacute; van todas las acciones del documento.</span>\r\n<span class=\"&quot;p&quot;\">});</span>\r\n</pre>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><img id=\"imagenart\" src=\"uploads/entrada_imagenes//jquery2.png\" /></p>', '2017-11-14 13:36:24');
INSERT INTO `entrada` (`titulo`, `contenido`, `fecha_entrada`) VALUES
('PHP', '\r\n<p><strong>PHP</strong> es un <a title=\"Lenguaje de programaci&oacute;n\" href=\"https://es.wikipedia.org/wiki/Lenguaje_de_programaci%C3%B3n\">lenguaje de programaci&oacute;n</a> <a title=\"Lenguaje de programaci&oacute;n de prop&oacute;sito general\" href=\"https://es.wikipedia.org/wiki/Lenguaje_de_programaci%C3%B3n_de_prop%C3%B3sito_general\">de prop&oacute;sito general</a> de <a title=\"Script del lado del servidor\" href=\"https://es.wikipedia.org/wiki/Script_del_lado_del_servidor\">c&oacute;digo del lado del servidor</a> originalmente dise&ntilde;ado para el <a title=\"Desarrollo web\" href=\"https://es.wikipedia.org/wiki/Desarrollo_web\">desarrollo web</a> de <a title=\"Contenido din&aacute;mico\" href=\"https://es.wikipedia.org/wiki/Contenido_din%C3%A1mico\">contenido din&aacute;mico</a>. Fue uno de los primeros lenguajes de programaci&oacute;n del lado del servidor que se pod&iacute;an incorporar directamente en el documento <a title=\"HTML\" href=\"https://es.wikipedia.org/wiki/HTML\">HTML</a> en lugar de llamar a un archivo externo que procese los datos. El c&oacute;digo es interpretado por un servidor web con un m&oacute;dulo de procesador de PHP que genera la p&aacute;gina web resultante. PHP ha evolucionado por lo que ahora incluye tambi&eacute;n una interfaz de <a class=\"mw-redirect\" title=\"L&iacute;nea de comandos\" href=\"https://es.wikipedia.org/wiki/L%C3%ADnea_de_comandos\">l&iacute;nea de comandos</a> que puede ser usada en <a title=\"Interfaz gr&aacute;fica de usuario\" href=\"https://es.wikipedia.org/wiki/Interfaz_gr%C3%A1fica_de_usuario\">aplicaciones gr&aacute;ficas</a> independientes. Puede ser usado en la mayor&iacute;a de los servidores web al igual que en casi todos los sistemas operativos y plataformas sin ning&uacute;n costo.</p>\r\n<p>Fue creado originalmente por <a title=\"Rasmus Lerdorf\" href=\"https://es.wikipedia.org/wiki/Rasmus_Lerdorf\">Rasmus Lerdorf</a> en el a&ntilde;o 1995. Actualmente el lenguaje sigue siendo desarrollado con nuevas funciones por el grupo PHP. Este lenguaje forma parte del <a title=\"Software libre\" href=\"https://es.wikipedia.org/wiki/Software_libre\">software libre</a> publicado bajo la <a title=\"Licencia PHP\" href=\"https://es.wikipedia.org/wiki/Licencia_PHP\">licencia PHP</a>, que es incompatible con la <a title=\"GNU General Public License\" href=\"https://es.wikipedia.org/wiki/GNU_General_Public_License\">Licencia P&uacute;blica General de GNU</a> debido a las restricciones del uso del t&eacute;rmino <em>PHP</em></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"\" width=\"575\" height=\"323\" /></p>\r\n<h3><em>Etimolog&iacute;a</em></h3>\r\n<p><em>PHP es un <a title=\"Acr&oacute;nimo recursivo\" href=\"https://es.wikipedia.org/wiki/Acr%C3%B3nimo_recursivo\">acr&oacute;nimo recursivo</a> que significa <em>PHP Hypertext Preprocessor</em> (inicialmente <em>PHP Tools</em>, o, <em>Personal Home Page Tools</em>). Fue creado originalmente por <a title=\"Rasmus Lerdorf\" href=\"https://es.wikipedia.org/wiki/Rasmus_Lerdorf\">Rasmus Lerdorf</a>; sin embargo, la implementaci&oacute;n principal de PHP es producida ahora por The PHP Group y sirve como el est&aacute;ndar de facto para PHP, al no haber una especificaci&oacute;n formal. Publicado con la PHP License, la <a title=\"Free Software Foundation\" href=\"https://es.wikipedia.org/wiki/Free_Software_Foundation\">Free Software Foundation</a> considera esta licencia como <a title=\"Software libre\" href=\"https://es.wikipedia.org/wiki/Software_libre\">software libre</a>.</em></p>\r\n<p><em><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/png;base64,\" alt=\"\" /></em></p>\r\n<h3><em>Visi&oacute;n General</em></h3>\r\n<p><em>PHP puede ser desplegado en la mayor&iacute;a de los servidores web y en casi todos los sistemas operativos y plataformas sin costo alguno. El lenguaje PHP se encuentra instalado en m&aacute;s de 20 millones de sitios web y en un mill&oacute;n de servidores. El n&uacute;mero de sitios basados en PHP se ha visto reducido progresivamente en los &uacute;ltimos a&ntilde;os, con la aparici&oacute;n de nuevas tecnolog&iacute;as como Node.JS, Golang, ASP.NET, etc. El sitio web de Wikipedia est&aacute; desarrollado en PHP. <sup id=\"cite_ref-porcentaje_4-0\" class=\"reference separada\"></sup>Es tambi&eacute;n el m&oacute;dulo Apache m&aacute;s popular entre las computadoras que utilizan Apache como servidor web.</em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2017-11-14 13:40:20');

